import { createSlice } from '@reduxjs/toolkit'

const initialState = {value:usersData}

const userSlice = createSlice({
    name: 'user',
    initialState,
    reducers: {
        addUser: (state) => {
            state.value++
        },
        deleteUser: () => {

        },
    },
})


export const { addUser, deleteUser } = userSlice.actions
export default userSlice.reducer
